import React from 'react'; 
import "./Navbar.scss"; 
import { Link } from 'react-scroll';
import { FaHome } from 'react-icons/fa';

const Navbar = props => {
 return (
   <nav className="navbar">
    <ul>
      <li>
        <Link to="header" smooth="easeInQuad" duration={250}>
          <FaHome/>          
        </Link>
      </li>
      <li>
        <Link to="about" smooth="easeInQuad" duration={250}>
          About
        </Link>
      </li>
      <li>
        <Link to="projects" smooth="easeInQuad" duration={250}>
          Projects
        </Link>
      </li>
    </ul>
  </nav>
 );
} 

export default Navbar;
